                                <c style={{ color: "red" }}>* </c> ตำบล/แขวง :
                              </label>
                              <Form.Item
                                name="district"
                                rules={[
                                  { required: true, message: "กรุณากรอกตำบล" },
                                ]}
                                hasFeedback
                              >
                                <Col span={4}>
                                  <div style={style}>
                                    <Input
                                      placeholder="กรุณากรอกตำบล"
                                      style={{
                                        width: "600%",
                                        borderRadius: "0.5em",
                                      }}
                                    />
                                  </div>
                                </Col>
                              </Form.Item>
                            </div>
                          </Col>
                          <Col span={4}>
                            <div style={style}>
                              <label
                                style={{ fontSize: "3ch", color: "black" }}
                              >
                                <c style={{ color: "red" }}>* </c> อำเภอ/เขต :
                              </label>
                              <Form.Item
                                name="prefecture"
                                rules={[
                                  { required: true, message: "กรุณากรอกอำเภอ" },
                                ]}
                                hasFeedback
                              >
                                <Col span={4}>
                                  <div style={style}>
                                    <Input
                                      placeholder="กรุณากรอกอำเภอ"
                                      style={{
                                        width: "600%",
                                        borderRadius: "0.5em",
                                      }}
                                    />
                                  </div>
                                </Col>
                              </Form.Item>
                            </div>
                          </Col>
                        </Row>

                        <Row gutter={22} style={{ paddingBottom: "10px" }}>
                          <Col span={2} />

                          <Col span={4}>
                            <div style={style}>
                              <label
                                style={{ fontSize: "3ch", color: "black" }}
                              >
                                <c style={{ color: "red" }}>* </c> จังหวัด :
                              </label>
                              <Form.Item
                                name="province"
                                rules={[
                                  {
                                    required: true,
                                    message: "กรุณากรอกจังหวัด",
                                  },
                                ]}
                                hasFeedback
                              >
                                <Col span={4}>
                                  <div style={style}>
                                    <Input
                                      placeholder="กรุณากรอกจังหวัด"
                                      style={{
                                        width: "600%",
                                        borderRadius: "0.5em",
                                      }}
                                    />
                                  </div>
                                </Col>
                              </Form.Item>
                            </div>
                          </Col>
                        </Row>

                        <pre
                          style={{
                            marginTop: "-300px",
                            marginRight: "40px",
                            textAlign: "right",
                          }}
                        >
                          {" "}
                          <Map />
                        </pre>
                      </div>
                    </Form>


                  {fields.length > 1 ? (
                    <Button
                      type="danger"
                      onClick={() => {
                        remove(field.name);
                      }}
                      style={{ width: "auto", marginTop: "20px" }}
                    >
                      <MinusCircleOutlined /> ลบที่อยู่ฟาร์ม
                    </Button>
                  ) : null}
                </Form.Item>
              ))}

              <Form.Item>
                <Button
                  type="primary"
                  onClick={() => {
                    add();
                  }}
                  style={{ width: "auto" }}
                >
                  <PlusOutlined /> เพิ่มที่อยู่ฟาร์ม
                </Button>
              </Form.Item>
            </div>
          );
        }}
      </Form.List>
    </Form>
                </Content>
                <div style={{ textAlign: "center" }}>
                  <Button type="primary" danger style={{ fontSize: "3.5ch" }}>
                    ยกเลิก
                  </Button>
                  <Button
                    style={{
                      backgroundColor: "#4CAF50",
                      color: "white",
                      border: "#4CAF50",
                      marginLeft: "10px",
                      fontSize: "3.5ch",
                    }}
                    onClick={showConfirm}
                  >
                    บันทึก
                  </Button>
                </div>
              </div>
            </Addofficer>
          </Layout>
        </div>
      </form>
    );
  }
